import React from 'react';

import './Task.scss';

const Task = (): JSX.Element => {
    return (
        <div className="task">
            <div className="task__category"></div>
            <div className="task__name"></div>
            <div className="task__date"></div>
            <div className="task__status"></div>
        </div>
    );
}

export default Task;
